import * as actions from './actionTypes';

export default function reducer(state = [], action) {
    switch (action.type) {
        case actions.STORIES_UPDATE:
            console.log('here');
            return action.payload;
        case actions.COMMENTS_OPEN:
            return ;
        case actions.COMMENTS_CLOSE:
            return ;
        default:
            return state;
    }
}
